window.bookSummaryJSON = "<p><b>A no-excuses kick-in-the-ass to wellness, from an award-winning trainer and fitness expert. </b></p> <p><b>Join the movement. Ditch the diet. </b></p> <p>Who is ready to stop thinking about weight loss? To free their brain from thoughts about ketones, calories, and fasting? Who wants life to be more effortless, energetic, and empowered?&nbsp;</p> <p>Welcome to a refreshing and gloriously unapologetic conversation about health, fitness, and habits. Award-winning trainer Oonagh Duncan cuts through the wellness clutter to drop some truth bombs: It might not be six-pack abs you’re looking for - it might be happiness, confidence, and acceptance. But if losing your belly is what you want, don’t let anyone - including yourself - stop you from going after it. And she’ll show you how to make it happen.&nbsp;</p> <p>There’s only one major difference between those rare people who have managed to lose weight and the rest of us: their habits. When you acknowledge that following a diet is not getting you anywhere and you make a few small changes to your everyday routine, you’ll find yourself happier and healthy as f--k.</p>"; 
